// require ("dotenv").config() 
import React, {useState, useEffect, createContext, useContext} from "react"
import styled from "styled-components"
import {VscMenu} from "react-icons/vsc"
import * as MdIcons from "react-icons/md"
//import Empty from "../Pages/Empty"
import Sidebardata from "./Sidebardata"
import { Link, Outlet} from "react-router-dom"
import * as RiIcons from "react-icons/ri"
// import Submenu from "./Submenu"
import {FaUserCircle} from "react-icons/fa"
// import xDownloadOptions from "helmet/dist/types/middlewares/x-download-options"
// console.log(logo)
import {useJwt, decodeToken} from "react-jwt";
// import env from "react-dotenv"
// const logo= require ("./easyclickslogo.png")
const logo= require ("./easy4.png")

const King= styled.div`
position:fixed;
width:100%;
height:100%;
top:0;
left:0; 
background-color:#F8F8F8;
`
const Nav = styled.div`
  // display:grid;
  // grid-template-columns: ${({sidebar})=> sidebar ? `4% 96% ` : `22.5% 77.5%`} ;
  // grid-template-rows:600px  auto ;
  background-color:blue;


`
const Navigation=styled.div  `
position:fixed;
overflow:hidden;
display:flex;
top:0;
z-index:20;
left:0;
width:100%;
height:57px;
justify-content:space-between;
align-items:center;
// background-color:#F8F8F8;
background-color:black;
// box-shadow: rgba(0, 0, 0, 0.15) 1.95px 1.95px 2.6px;



`

const Navdiv= styled.div`
position:fixed;
top:10px;
left:0;
color:black;

`

const Naviconburger= styled(Link)` 
  list-style:none;
  padding:0.5rem;
  // color:rgb(85, 74, 74);
  color:violet;
  font-size:2.6rem;
  text-decoration:none;

`

const Logodiv=styled.div`
font-size:1.8rem;
font-weight:400;
Margin-left:4rem;
justify-item:center;
text-align:center;
color:violet;
// position:fixed;
// overflow:hidden;
// display:flex;
// justify-content:center;

`

const Logo= styled.div`
text-align:center;

`


const Registerdiv=styled.div`
margin-right:5rem;
display:flex;
height:25%;
justify-content:space-around;
align-items:center;

`
// const Tenantlogo= styled.div`
// text-transform:uppercase;
// color:white;
// margin-left:1rem;
// font-weight:bold;

// `
const SignIn=styled.button`
fontSize:4rem;
color:white;
border:none;
font-weight:bold;
padding:0.5rem;
background-color:green;
border-radius:7px;
border:none;
margin-right:1rem;
cursor:pointer;

`
const SignUp=styled.button`
fontSize:4rem;
padding:0.5rem;
color:white;
background-color:blue;
border:none;
cursor:pointer;
border-radius:7px;
font-weight:bold;
`



  const Wholeprofile=styled.div`
    right:3%;
    position:fixed; 
    top:0;
    color:white;


  `
  const Profile  = styled.div`

  `
  const Profileshow = styled(Link)`
    display:flex;
    // color:rgb(59, 57, 57);
    color:violet;
    // background-color:green;
    justify-content:space-evenly;
    outline:none;
    border:none;
    align-items:center;
    text-align:center;
    height:56px;
    text-decoration:none;
    display:flex;;

    &:hover{
      // background-color:#EFEBF3;
      background-color:white;
    } 
  `
  const Profilehide = styled.div`
  background-color:blue;
  top:70px;

  `
  const Showusername = styled.div`
  // margin-left:-2.5rem;

  `
  const Username = styled.div`


  `
  const Iconimage = styled.div`
    font-size:1.3rem;
    // margin-left:-1rem;


  `
  const Dropicon = styled.div`

  `

 const Settingrow = styled(Link)`
 padding:0.5rem 1rem;
 display:flex;
 color:white;
 text-decoration:none;
 &:hover{
  background-color: grey;
 };
 justify-content:space-evenly;
 text-align:center;

 `
 const Icons = styled.div`

   margin-right:0.5rem;
 `
// Here is some content from the drop xDownloadOptions, 
//  const Dropdownmenu= styled.div` 
//  padding:0rem;

// `




const SidebarNav=styled.div  `
position:fixed;
overflow:${({sidebar})=>sidebar?"hidden": "scroll"};
top:${({sidebar})=>sidebar? "56px":"58px"};
width:${({sidebar})=> sidebar ? "3.5%": "21.5%"};
display:grid;
height:88vh;
color:violet;
left:${({sidebar})=> sidebar ? "0": "0"};
background-color:black;
box-sizing:border-box;
// border-radius:20px;
// overflow-x:hidden;

::-webkit-scrollbar {
  width: 7.5px;               /* width of the entire scrollbar */
  height:7.5px;
}

::-webkit-scrollbar-track {
  background-color: #F5F5F5;        /* color of the tracking area */
}

::-webkit-scrollbar-thumb {
  background-color: gray;    /* color of the scroll thumb */
  border-radius: 20px;       /* roundness of the scroll thumb */
  // border: 1px solid orange;  /* creates padding around scroll thumb */
}
::-webkit-scrollbar-corner {
  background-color: #F8F8F8;    /* color of the scroll thumb */
  // border-radius: 20px;       /* roundness of the scroll thumb */
  // border: 1px solid orange;  /* creates padding around scroll thumb */
}
`
const Scroll=styled.div`
background-color:violet;
display:flex;
text-align:center;
position:fixed;
left:${({sidebar})=> sidebar ? "3.6%": "21.5%" };
top:0;
z-index:10;
width:10px;
height:97.6vh;
justify-content:space-between;

`
const Openscroll=styled.div`
left:${({sidebar})=> sidebar ? "3.5%": "21.5%" };
z-index:10;
position:fixed;
text-decoration:none;
width:20px;
height:90px;
display:flex;
align-items:center;
color:white;
text-align:center;
background-color:purple;
border-top-right-radius:16%;
top:40%;
border-bottom-right-radius:16%;
&hover:{
  cursor:pointer;

}
`

const Switchdiv= styled.div`
 position:fixed;
 top:65px;
 border-radius:20px;
 left:${({sidebar})=> sidebar ? "5.2%": "23.2%"};
 width:${({sidebar})=> sidebar ? "93.8%": "75.8%"};
 height:86vh;
 background-color:white;

 //  border:3px solid black;
//  overflow-x:hidden;
//  overflow-y:scroll;
`

const Submenuwrap= styled(Link)`
    display:flex;
    padding:0.5rem 0;
    text-decoration:none;
    align-items:center;
    box-sizing:border-box;
    margin-right:0rem;
    justify-content:space-between;
    width:${({sidebar})=>sidebar? "100%" : "100%"};
    &:hover {${({sidebar})=>sidebar? `background-color:blue` :`background-color:blue; margin-left:0.2rem`}}
    // &:hover {${({sidebar})=>sidebar? `background-color:blue; transition:0.2s;` :`background-color:blue; margin-left:0.2rem;  transition:0.5s;`}}
