        setloggedIn(true);
        email = token.user.email;

        name= email.substring(0, email.lastIndexOf("@"))
        setuserName(name)
        setloggedIn(true)

        // console.log("show isLogged In" + isloggedin)

      }
      else{
        setloggedIn(false)
        // console.log("not logged In")
      }
    }


  }, [isloggedin])


  console.log("show isLogged In?" + isloggedin)

  return(
  <King style={{}}>
    <Nav sidebar={sidebar? 1: 0}>

      <Navigation>
        <Logodiv>
          <Logo>
